// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./access/Mintable.sol";
import "./interfaces/ILandNFT.sol";

contract LandNFT is ILandNFT, ERC721, Ownable, Mintable {
  using Counters for Counters.Counter;
  using Strings for uint8;

  Counters.Counter private currentTokenId;

  mapping(uint => LandAttr) private attrs;
  string private baseTokenUri;

  constructor() ERC721("CashCow Land NFT", "CLN") {

  }

  function mint(uint8 _rarity, uint8 _kind, address _owner) public onlyMintable {
    require(_owner != address(0), "LandNFT: Owner must be non-zero address.");

    currentTokenId.increment();
    uint256 tokenId = currentTokenId.current();
    attrs[tokenId] = LandAttr(_rarity, _kind);
    _safeMint(_owner, tokenId);
  }

  function attrOf(uint _tokenId) public view returns (LandAttr memory) {
    return attrs[_tokenId];
  }

  // Get list of tokenIds of owner.
  function tokenIdsOf(address _owner) public view returns (uint[] memory) {
    uint tokenAmount = balanceOf(_owner);
    uint[] memory tokenIds = new uint[](tokenAmount);
    if(tokenAmount == 0) {
      return tokenIds;
    }

    uint tokenIdx = 0;
    for(uint tokenId=1;tokenId <= currentTokenId.current();tokenId ++) {
      if(ownerOf(tokenId) == _owner) {
        tokenIds[tokenIdx] = tokenId;
        tokenIdx ++;
      }
    }

    return tokenIds;
  }

  function setBaseTokenURI(string memory _baseUri) public {
    baseTokenUri = _baseUri;
  }

  function tokenURI(uint _tokenId) public view override returns (string memory) {
    require(_exists(_tokenId), "LandNFT: Token URI for nonexistent token");

    LandAttr memory attr = attrOf(_tokenId);
    string memory tokenUri = string(abi.encodePacked(attr.landType.toString(), "-", attr.rarity.toString(), ".json"));
    string memory base = _baseURI();

    // If there is no base URI, return the token URI.
    if (bytes(base).length == 0) {
        return tokenUri;
    }
    // If both are set, concatenate the baseURI and tokenURI (via abi.encodePacked).
    if (bytes(tokenUri).length > 0) {
        return string(abi.encodePacked(base, tokenUri));
    }

    return super.tokenURI(_tokenId);
  }

  function setMintable(address _addr) public override onlyOwner {
    require(_addr != address(0), "LandNFT: Mintable must be non-zero address");
    mintable[_addr] = true;
  }

  function _baseURI() internal view override returns (string memory) {
    return baseTokenUri;
  }

}
